  return (
    <div className="Login">
      <form action="POST">
        <input type="text" placeholder="Enter Username" />
        <input type="password" placeholder="Enter Password" />
        <button className="login-submit-buttn">Submit</button>
      </form>
    </div>
  );
}
export default Login;
